import React from 'react';
import NavigationItem from './NavigationItem/NavigationItem';
import classes from './NavigationItems.module.css';

const navigationItems = (props) => (
    <ul className={classes.NavigationItems}>
        <NavigationItem link="/products" exact active>Products</NavigationItem>
        <NavigationItem link="/salespersons" exact>Salespersons</NavigationItem>
        <NavigationItem link="/sales" exact>Sales</NavigationItem>
        <NavigationItem link="/customers" exact>Customers</NavigationItem>
    </ul>
);

export default navigationItems;
